import {Helmet} from "react-helmet";
import "./SignInForm.css";

const SignInForm = () => {
    return (
            <div id="signin-form">
                
                <Helmet>
                    <title>Sign In</title>         
                </Helmet>
                <h2>sad</h2>
            </div>
    )
}

export default SignInForm;
